webpackJsonp([0xd5ef1d66a803],{575:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Eh, I Could Eat",author:"Jacob Aronoff"}},markdownRemark:{id:"/Users/jea/Documents/Code/github/icouldeat/src/pages/tipsy-parson/index.md absPath of file >>> MarkdownRemark",html:'<h3>Mushroom Toast</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/picture-ef0d2f723d9f79a8b88cdee4b90e3572-99c36.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 86.67328042328043%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Mushroom Toast"\n        title=""\n        src="/static/picture-ef0d2f723d9f79a8b88cdee4b90e3572-f8fb9.jpg"\n        srcset="/static/picture-ef0d2f723d9f79a8b88cdee4b90e3572-e8976.jpg 148w,\n/static/picture-ef0d2f723d9f79a8b88cdee4b90e3572-63df2.jpg 295w,\n/static/picture-ef0d2f723d9f79a8b88cdee4b90e3572-f8fb9.jpg 590w,\n/static/picture-ef0d2f723d9f79a8b88cdee4b90e3572-85e3d.jpg 885w,\n/static/picture-ef0d2f723d9f79a8b88cdee4b90e3572-d1924.jpg 1180w,\n/static/picture-ef0d2f723d9f79a8b88cdee4b90e3572-9452e.jpg 1770w,\n/static/picture-ef0d2f723d9f79a8b88cdee4b90e3572-99c36.jpg 3024w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>This may have been the best mushroom toast I’ve ever had. The perfectly cooked mushrooms were on top of some ricotta cheese and a great piece of toast. I’m not a huge fan of avocado toast, I think avocado is a good addition, but doesn’t give enough flavor by itself. In this case though, the simple combo of the ricotta cheese, eggs, and mushrooms produced an absolutely amazing flavor. Chef’s on youtube like to talk about meals that are greater than the sum of their parts, and this is definitely one of them. This is the kind of meal that I’m definitely going to be cooking at home for myself on a weekend.</p>\n<p>Rating: 9/10</p>',frontmatter:{title:"Tipsy Parson",date:"February 10, 2018"}}},pathContext:{slug:"/tipsy-parson/",previous:{fields:{slug:"/cafeteria/"},frontmatter:{title:"Cafeteria"}},next:{fields:{slug:"/jun-men-ramen/"},frontmatter:{title:"Jun-Men Ramen"}}}}}});
